BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `version` (
	`_id`	integer,
	PRIMARY KEY(`_id`)
);
CREATE TABLE IF NOT EXISTS `tracks_wpts` (
	`trk`	integer,
	`wpt`	integer,
	PRIMARY KEY(`trk`,`wpt`)
);
CREATE TABLE IF NOT EXISTS `tracks` (
	`_id`	integer PRIMARY KEY AUTOINCREMENT,
	`trackname`	text,
	`trackdescr`	text,
	`trackfechaini`	integer,
	`trackestado`	integer,
	`tracktipo`	integer,
	`trackdir`	text,
	`trackfolder`	text,
	`tracklat`	real DEFAULT 999,
	`tracklon`	real DEFAULT 999,
	`trackciudad`	text,
	`trackpais`	text,
	`trackidserver`	integer DEFAULT -1,
	`trackdificultad`	integer,
	`trackuser`	text,
	`trackuserid`	integer DEFAULT -1,
	`trackibpmod`	text,
	`trackibp`	integer DEFAULT -1,
	`trackibpref`	text,
	`trackcoef`	real DEFAULT 0.049,
	`trackstrav`	integer DEFAULT -1
);
CREATE TABLE IF NOT EXISTS `trackpoints` (
	`_id`	integer PRIMARY KEY AUTOINCREMENT,
	`trkptlat`	real,
	`trkptlon`	real,
	`trkptalt`	real,
	`trkpttime`	integer,
	`trkpttrack`	integer,
	`trkptseg`	integer,
	`trkptsen`	blob
);
CREATE TABLE IF NOT EXISTS `segments` (
	`_id`	integer PRIMARY KEY AUTOINCREMENT,
	`segname`	text,
	`segdescr`	text,
	`segfechaini`	integer,
	`segfechafin`	integer,
	`segtimeup`	integer,
	`segtimedown`	integer,
	`segmaxalt`	real,
	`segminalt`	real,
	`segavgspeed`	real,
	`segupalt`	real,
	`segdownalt`	real,
	`segdist`	real,
	`segtimemov`	integer,
	`segtrack`	integer,
	`segmaxspeed`	real,
	`segcolor`	integer,
	`segstroke`	real,
	`segfill`	integer,
	`segfillColor`	integer
);
CREATE TABLE IF NOT EXISTS `pois` (
	`_id`	integer PRIMARY KEY AUTOINCREMENT,
	`poiname`	text,
	`poidescr`	text,
	`poilat`	real,
	`poilon`	real,
	`poialt`	real,
	`poitime`	integer,
	`poitipo`	integer,
	`poiuri`	text,
	`poitrack`	integer,
	`poicache`	text,
	`poifounddate`	integer,
	`poinotes`	text,
	`poiurl`	text,
	`poiurlname`	text,
	`poifolder`	text,
	`poiciudad`	text,
	`poipais`	text,
	`poiidserver`	integer DEFAULT -1,
	`poiuser`	text,
	`poiuserid`	integer DEFAULT -1,
	`poima_z`	integer DEFAULT 25,
	`poimi_z`	integer DEFAULT 0
);
CREATE TABLE IF NOT EXISTS `heart` (
	`_id`	integer PRIMARY KEY AUTOINCREMENT,
	`hrtrack`	integer,
	`hrbpm`	integer,
	`hrposi`	integer,
	`hrresp`	integer,
	`hrtemp`	integer,
	`hrdate`	integer,
	`hrspeed`	integer
);
CREATE TABLE folders (
_id INTEGER CONSTRAINT PK_folders_id PRIMARY KEY ASC AUTOINCREMENT,
folname VARCHAR (50),
foltype VARCHAR (3),
folactive BOOLEAN DEFAULT (1) );
CREATE TABLE IF NOT EXISTS `ext` (
	`_id`	integer PRIMARY KEY AUTOINCREMENT,
	`extpoi`	integer,
	`exttipo`	integer,
	`extsubtipo`	integer,
	`extdata`	text,
	`exttrack`	integer
);
CREATE TABLE IF NOT EXISTS `android_metadata` (
	`locale`	TEXT
);
CREATE INDEX IF NOT EXISTS `IDX_pois_poiname` ON `pois` (
	`poiname`	ASC
);
COMMIT;
